import React from "react";
import { useLocation } from 'react-router-dom';
import './home.css';

function Home() {
    const [userData, setUserData] = useState(null);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await axios.post("http://localhost:8000/", { email });
                setUserData(response.data);
            } catch (error) {
                console.error("Error fetching user data:", error);
            }
        };

        fetchUserData();
    }, [email]);
    return (
        <div className="container">
            <div className="box">
                <div style={{ textAlign: "center" }}>Connected Devices: <br />
                    <span>{userData.connectedDevices}</span>
                </div>
                <div className="right">Network Device Name: <br /> <span>{networkDevicesname}</span></div>
                <div className="left"><span>{userData.username}</span></div>
            </div>
            <div className="div1">
                <div>
                    <p><i className="fa-solid fa-wallet" style={{ color: "orange" }}></i> Current Balance: <span>{currentBalance}</span></p>
                    <p><i className="fa-solid fa-coins" style={{ color: "orange" }}></i> Amount Due: Ksh <span>{Amount}</span></p>
                </div>
                <div>
                    <p><i className="fa-solid fa-check fa-lg" style={{ color: "#2fb90c" }} ></i> Payment Status: <span>{paymentStatus}</span></p>
                </div>
            </div>
            <div className="div2">
                <p>Current Package</p>
                <div className="net">
                    <div>
                        <p className="span"><span>{networkSpeed}</span></p>
                        <p>Network Speed</p>
                    </div>
                    <div className="line"></div>
                    <div>
                        <p className="span"><span id="remainingDays">{remainingDay}</span> Days</p>
                        <p id="expiryDate">Expires on: <span id="expiryDateValue">{subscriptionStartDate}</span></p>
                    </div>
                </div>
            </div>
            <div className="div3">
                <div>
                    <p><i className="fa-solid fa-signal" style={{ color: "#dcedf9" }}></i> Signal Strength </p>
                    <p className="dbm">{signalStrength}</p>
                </div>
            </div>
            <div className="net">
                <a href="https://wa.me/+254772809396" target="_blank" rel="noopener noreferrer">Chat with us on WhatsApp</a>
                <a href="/" className="button">Log out</a>
            </div>
        </div>
    );
}

export default Home;
